मराठी, इंग्रजी, हिंदी भाषेतील मनोरंजन मासिकं मी लहानपणापासून पाहते आहे, वाचते आहे. माझ्या आवडीच्या हिरो-हिरोइन्सची कव्हरपेज नेहमीच मला भुरळ घालून जायची. या क्षेत्रात मी आले तेव्हा वाटायचं की आपणही कधीतरी मासिकाच्या कव्हरपेजवर यायला हवं. ते स्वप्न आता इतक्या वर्षांनी पूर्ण होतंय. ‘तारांगण’ या मराठीमधील एकमेव मराठी मासिकाच्या जुलै महिन्याच्या कव्हरवर मी झळकले आहे. तसेच माझी मुलाखतदेखील त्यात प्रसिद्ध झाली आहे. माझ्यासाठी हा खूप आनंदाचा प्रसंग आहे. आज हे कव्हरपेज तुम्हा सर्वांसाठी शेअर करतेय. ‘तारांगण’चे संपादक मंदार जोशी यांचे खूप खूप आभार!

